	if(columns.length === 0 && data.length > 0) {
		columns = Object.keys(data[0]).map(function(columnid){return {columnid:columnid}});
	}
	// If one parameter
	if(typeof filename === 'object') {
		opts = filename;
		filename = undefined;
	}

	var res = data.length;
